script: |
  super -f text -I q3362.spq | sort > q3362.out

inputs:
  - name: q3362.spq
    data: |
      SELECT + col1 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col1 BETWEEN + CAST ( + - 74 AS INTEGER ) AND ( - + col1 + - 29 - - col2 + - ( + 81 ) * col0 );
  - name: tab1

outputs:
  - name: q3362.out
    data: |
      14
      47
      5
